DROP TABLE IF EXISTS `vacancy`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `vacancy` (
  `id` int(11) NOT NULL,
  `name` varchar(45) DEFAULT NULL,
  `desription` varchar(1000) DEFAULT NULL,
  `date` date DEFAULT NULL,
  `salary` int(10) DEFAULT NULL,
  `experiance` varchar(100) DEFAULT NULL,
  `location` varchar(100) DEFAULT NULL,
  `id_busymode` int(11) DEFAULT NULL,
  `id_company` int(11) DEFAULT NULL,
  `id_category` int(11) DEFAULT NULL,
  `id_admin` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `company_idx` (`id_company`),
  KEY `busymode_idx` (`id_busymode`),
  KEY `category_idx` (`id_category`),
  KEY `admin_idx` (`id_admin`),
  CONSTRAINT `admin` FOREIGN KEY (`id_admin`) REFERENCES `admin` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `busymode` FOREIGN KEY (`id_busymode`) REFERENCES `busymode` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `category` FOREIGN KEY (`id_category`) REFERENCES `category` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `company` FOREIGN KEY (`id_company`) REFERENCES `company` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
